"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?12/63/13302/abstract/1\">",
"      Zhu BP, Rolfs RT, Nangle BE, Horan JM. Effect of the interval between pregnancies on perinatal outcomes. N Engl J Med 1999; 340:589.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?12/63/13302/abstract/2\">",
"      Conde-Agudelo A, Rosas-Berm&uacute;dez A, Kafury-Goeta AC. Birth spacing and risk of adverse perinatal outcomes: a meta-analysis. JAMA 2006; 295:1809.",
"     </a>",
"    </li>",
