var title_f12_63_13309="Lithium poisoning - Rapid overview";
var content_f12_63_13309=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F53656&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F53656&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Emergent management of lithium poisoning: Rapid overview",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        <span style=\"color: #ff0000;\">",
"         To obtain emergent consultation with a medical toxicologist, call the United States Poison Control Network at 1-800-222-1222, or access the World Health Organization's list of international poison centers (",
"        </span>",
"        <a href=\"file://www.who.int/gho/phe/chemical_safety/poisons_centres/en/index.html\" target=\"_blank\">",
"         www.who.int/gho/phe/chemical_safety/poisons_centres/en/index.html",
"        </a>",
"        <span style=\"color: #ff0000;\">",
"         ).",
"        </span>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Clinical presentation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Acute poisoning often presents with nausea, vomiting, and diarrhea; neurologic findings develop late",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Chronic poisoning often presents with neurologic findings: sluggishness, ataxia, confusion, agitation, and/or neuromuscular excitability",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Severe poisoning can cause seizures, nonconvulsive status epilepticus, or encephalopathy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Elder patients are at higher risk; poisoning may stem from dehydration or decline in renal function",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        History and physical examination",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Determine nature of ingestion (eg, acute or chronic, suicide attempt), including whether ingested drug is standard formulation or sustained release",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Inquire about recent illness causing dehydration (eg, vomiting, diarrhea, fever, anorexia)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Assess for signs of dehydration",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Perform a focused neurologic examination; look for alterations in mentation, ataxia, and neuromuscular excitability (eg, tremors, myoclonus)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Diagnostic evaluation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Obtain serum lithium concentration upon presentation and repeat every 2 to 4 hours during initial management; normal range 0.8 and 1.2 mEq/L (mmol/L); drug concentration may",
"        <strong>",
"         not",
"        </strong>",
"        correlate with clinical severity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Obtain the following blood tests: fingerstick glucose; basic electrolytes (including Na, K, Cl, HCO3); creatinine and BUN; complete blood count (hemoglobin, platelets, white blood cells); acetaminophen and salicylate concentrations (with suicide attempt or possible coingestion); pregnancy test in women of childbearing age; thyrotropin (TSH)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Obtain an electrocardiogram",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Management",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Assess and stabilize airway, breathing, and circulation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Restore sodium and water balance:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        In adults, initiate IV hydration with isotonic saline at twice the maintenance rate for a total of approximately 2 to 3 liters, depending upon the patient's fluid status and cardiac function",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Monitor serum sodium closely (every 4 to 6 hours) in patients with lithium-induced nephrogenic diabetes insipidus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Give whole bowel irrigation with polyethylene glycol (PEG) solution to",
"        <strong>",
"         AWAKE ASYMPTOMATIC",
"        </strong>",
"        patients who present within 2 to 3 hours after an ingestion of more than 10 to 15 tablets of sustained-release lithium. The dose of PEG is 500 mL to 2 L of PEG per hour via nasogastric tube until the rectal effluent is clear.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Obtain nephrology consultation early for significant lithium poisoning, prior to the development of obvious indications for hemodialysis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Perform hemodialysis for the following indications:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Serum lithium concentration is greater than 4 mEq/L (or mmol/L), regardless of the clinical status of the patient",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Serum lithium concentration is greater than 2.5 mEq/L (or mmol/L) and the patient manifests signs of significant lithium toxicity (eg, seizures, depressed mental status), has renal insufficiency or other conditions that limit lithium excretion, or suffers from an illness that would be exacerbated by aggressive IV fluid hydration (eg, heart failure)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
